  false,\n\t\"url\": null,\n\t\"notes\": \"The Rappahannock River Valley National
  Wildlife Refuge is a relatively new refuge, and does not yet have a Master Plan,
  or a Comprehensive Conservation Plan. Therefore, this plan contains specific refuge
  fire management objectives and goals, which were developed from the Refuge founding
  documents. This plan details how prescribed burns may contribute greatly to the
  goal of promotion and preservation of biodiversity on the Refuge.\",\n\t\"owner_org\":
